DROP TABLE IF EXISTS `datetime_table`;
CREATE TABLE `datetime_table` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `var_date` date NOT NULL,
  `var_date_time` datetime NOT NULL,
  `var_timestamp` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `var_time` time NOT NULL,
  `var_year` year(4) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_czech_ci;

INSERT INTO `datetime_table` (`id`, `var_date`, `var_date_time`, `var_timestamp`, `var_time`, `var_year`) VALUES
(1,	'2019-10-28',	'2019-10-28 11:05:48',	'2019-10-28 10:05:48',	'11:05:48',	'1981');

DROP TABLE IF EXISTS `geos`;
CREATE TABLE `geos` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `var_geometry` geometry NOT NULL,
  `var_point` point NOT NULL,
  `var_linestring` linestring NOT NULL,
  `var_polygon` polygon NOT NULL,
  `var_multipoint` multipoint NOT NULL,
  `var_multilinestring` multilinestring NOT NULL,
  `var_multipolygon` multipolygon NOT NULL,
  `var_geometrycollection` geometrycollection NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_czech_ci;

INSERT INTO `geos` (`id`, `var_geometry`, `var_point`, `var_linestring`, `var_polygon`, `var_multipoint`, `var_multilinestring`, `var_multipolygon`, `var_geometrycollection`) VALUES
(1,	GeomFromText('LINESTRING(0 0,1 2,2 4)', SRID(var_geometry)),	GeomFromText('POINT(2 2)', SRID(var_point)),	GeomFromText('LINESTRING(0 0,1 1,2 2,3 3,4 4)', SRID(var_linestring)),	GeomFromText('POLYGON((50.866753 5.686455,50.859819 5.708942,50.851475 5.722675,50.841611 5.720615,50.834023 5.708427,50.840744 5.689373,50.858735 5.673923,50.866753 5.686455))', SRID(var_polygon)),	GeomFromText('MULTIPOINT(1 1,2 2,3 3)', SRID(var_multipoint)),	GeomFromText('MULTILINESTRING((0 0,1 1,1 2),(2 3,3 2,5 4))', SRID(var_multilinestring)),	GeomFromText('MULTIPOLYGON(((45.55215127678357 -122.65701296506451,45.52329405876074 -122.63572695432232,45.52473727138698 -122.56156923947856,45.54397656857749 -122.56088259397076,45.559363267325914 -122.60345461545514,45.56224780438123 -122.65220644650982,45.55215127678357 -122.65701296506451)))', SRID(var_multipolygon)),	GeomFromText('GEOMETRYCOLLECTION(POINT(1 1),POINT(6 6))', SRID(var_geometrycollection)));

DROP TABLE IF EXISTS `lists`;
CREATE TABLE `lists` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `var_enum` enum('choise1','choise2','choise3','choise4') COLLATE utf8mb4_czech_ci NOT NULL,
  `var_set` set('choise1','choise2','choise3','choise4') COLLATE utf8mb4_czech_ci NOT NULL,
  `strings_id` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `strings_id` (`strings_id`),
  CONSTRAINT `lists_ibfk_1` FOREIGN KEY (`strings_id`) REFERENCES `strings` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_czech_ci;

INSERT INTO `lists` (`id`, `var_enum`, `var_set`, `strings_id`) VALUES
