(4,	'',	'',	1);

DROP TABLE IF EXISTS `numbers`;
CREATE TABLE `numbers` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `var_tinyint` tinyint(4) NOT NULL,
  `var_smallint` smallint(6) NOT NULL,
  `var_mediumint` mediumint(9) NOT NULL,
  `var_int` int(11) NOT NULL,
  `var_bigint` bigint(20) NOT NULL,
  `var_decimal` decimal(10,2) NOT NULL,
  `var_float` float NOT NULL,
  `var_double` double NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_czech_ci;

INSERT INTO `numbers` (`id`, `var_tinyint`, `var_smallint`, `var_mediumint`, `var_int`, `var_bigint`, `var_decimal`, `var_float`, `var_double`) VALUES
