DROP TABLE IF EXISTS `strings`;
CREATE TABLE `strings` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `var_char` char(1) COLLATE utf8mb4_czech_ci NOT NULL,
  `var_varchar` varchar(255) COLLATE utf8mb4_czech_ci NOT NULL,
  `var_tinytext` tinytext COLLATE utf8mb4_czech_ci NOT NULL,
  `var_text` text COLLATE utf8mb4_czech_ci NOT NULL,
  `var_mediumtext` mediumtext COLLATE utf8mb4_czech_ci NOT NULL,
  `var_longtext` longtext COLLATE utf8mb4_czech_ci NOT NULL,
  `table_assoc_id` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `table_assoc_id` (`table_assoc_id`),
  CONSTRAINT `strings_ibfk_1` FOREIGN KEY (`table_assoc_id`) REFERENCES `table_assoc` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_czech_ci;

INSERT INTO `strings` (`id`, `var_char`, `var_varchar`, `var_tinytext`, `var_text`, `var_mediumtext`, `var_longtext`, `table_assoc_id`) VALUES
