DROP TABLE IF EXISTS `table_assoc`;
CREATE TABLE `table_assoc` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `binaries_id` int(11) NOT NULL,
  `datetime_table_id` int(11) NOT NULL,
  `geos_id` int(11) NOT NULL,
  `lists_id` int(11) NOT NULL,
  `numbers_id` int(11) NOT NULL,
  `strings_id` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `binaries_id` (`binaries_id`),
  KEY `geos_id` (`geos_id`),
  KEY `lists_id` (`lists_id`),
  KEY `numbers_id` (`numbers_id`),
  KEY `strings_id` (`strings_id`),
  KEY `datetime_table_id` (`datetime_table_id`),
  CONSTRAINT `table_assoc_ibfk_1` FOREIGN KEY (`binaries_id`) REFERENCES `binaries` (`id`),
  CONSTRAINT `table_assoc_ibfk_3` FOREIGN KEY (`geos_id`) REFERENCES `geos` (`id`),
  CONSTRAINT `table_assoc_ibfk_4` FOREIGN KEY (`lists_id`) REFERENCES `lists` (`id`),
  CONSTRAINT `table_assoc_ibfk_5` FOREIGN KEY (`numbers_id`) REFERENCES `numbers` (`id`),
  CONSTRAINT `table_assoc_ibfk_6` FOREIGN KEY (`strings_id`) REFERENCES `strings` (`id`),
  CONSTRAINT `table_assoc_ibfk_7` FOREIGN KEY (`datetime_table_id`) REFERENCES `datetime_table` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_czech_ci;

INSERT INTO `table_assoc` (`id`, `binaries_id`, `datetime_table_id`, `geos_id`, `lists_id`, `numbers_id`, `strings_id`) VALUES
